        const number = Math.floor(Math.random() * 10);
        setNumber(number)
    }



  return (
    <div class="container">
    <div class="row">
        <div class="col-lg-12 col-md-12 col-sm-12 text-center">
            <div id="main">
                <Number />
                <Button />
            </div>
        </div>
    </div>
</div>
  );
}

export default App;
